	public static void eliminate() {
		System.out.println(numbers.length);
		
		Set<String> numberSet = new LinkedHashSet<String>(); 
		for (String number : numbers) {
			numberSet.add(number);
		}
		System.out.println(numberSet.size() + " Numbers here****");
		for (String number : numberSet) {
			System.out.println(number);
		}
		System.out.println("****");
	}
	
	public static void eliminateEmails() {
		System.out.println(emails.length);
		
		Set<String> emailSet = new LinkedHashSet<String>(); 
		for (String email : emails) {
			emailSet.add(email);
		}
		System.out.println(emailSet.size() + " Emails here****");
		for (String email : emailSet) {
			System.out.println(email + ",");
		}
		System.out.println("****");
	}

